package src;

import java.awt.*;
import java.awt.event.*;
import java.util.ArrayList;

import javax.swing.*;

public class ScaleView extends JFrame {
	private JLabel root = new JLabel("Root Note:");
	private JLabel scalePattern = new JLabel("Scale:");
	private JButton showScale = new JButton("Get my scale");
	
	String[] notes = {"A", "A# / Bb", "B", "C", "C# / Db", "D", "D# / Eb", "E", "F", "F# / Gb", "G", "G# / Ab" };
	private JComboBox noteList = new JComboBox(notes);
	
	String[] scales = {
		"Major",
		"Natural Minor",
		"Melodic Minor",
		"Harmonic Minor"
	};
	private JComboBox scaleList = new JComboBox(scales);
	
	private JLabel resultLabel = new JLabel();
	
	ScaleView() {
		JPanel scalePanel = new JPanel();
		
		this.setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);
		this.setSize(950, 200);
		this.setResizable(false);
		//this.setLayout(null);
		
		//add root label
		root.setSize(30, 15);
		root.setLocation(200, 50);
		scalePanel.add(root);
		noteList.setSelectedIndex(0);
		scalePanel.add(noteList);
		scalePanel.add(scalePattern);
		scaleList.setSelectedIndex(0);
		scalePanel.add(scaleList);
		scalePanel.add(showScale);
		resultLabel.setFont(resultLabel.getFont().deriveFont(24.0f));
		scalePanel.add(resultLabel);
		
		this.add(scalePanel);
	}
	
	public String getRootNote() {
		return noteList.getSelectedItem().toString();
	}
	
	public String getScale() {
		return scaleList.getSelectedItem().toString();
	}
	
	public void displayScale(ArrayList<String> pattern) {
		//implement later
		StringBuilder result = new StringBuilder(50);
		
		for(int i=0; i < pattern.size()-1; i++) {
			result.append(pattern.get(i));
			
			if(i != pattern.size()-2) {
				result.append("   -   ");
			}
		}
		
		resultLabel.setText(result.toString());
	}
	
	void addScaleListener(ActionListener listenForShowScale) {
		showScale.addActionListener(listenForShowScale);
	}
}

package src;

import java.util.ArrayList;
import java.util.LinkedList;

public class ScaleModel {
	
	private CircularLinkedList scale;
	private Node root;
	
	public ScaleModel() {
		scale = new CircularLinkedList();
		
		scale.add("A");
		scale.add("A# / Bb");
		scale.add("B");
		scale.add("C");
		scale.add("C# / Db");
		scale.add("D");
		scale.add("D# / Eb");
		scale.add("E");
		scale.add("F");
		scale.add("F# / Gb");
		scale.add("G");
		scale.add("G# / Ab");
		
		root = scale.getHead();
	}
	
	public CircularLinkedList getScale() {
		return this.scale;
	}
	
	public Node getRoot() {
		return this.root;
	}
	
	public void setRoot(Node node) {
		this.root = node;
	}
	
	public Node halfStep(Node start) {
		return start.next;
	}
	
	public Node wholeStep(Node start) {
		return start.next.next;
	}
	
	public Node wholeHalfStep(Node start) {
		return start.next.next.next;
	}
	
	public ArrayList<String> parsePattern(String rootNote, String scalePattern) {
		ArrayList<String> pattern = new ArrayList<String>();
		
		while(!this.getRoot().text.equals(rootNote)) {
			this.setRoot(this.getRoot().next);
		}
		
		Node hold = this.getRoot();
		pattern.add(hold.text);
		
		for(int i=0; i < scalePattern.length(); i++) {
			if(scalePattern.charAt(i) == 'H') {
				hold = halfStep(hold);
				pattern.add(hold.text);
			}
			
			if(scalePattern.charAt(i) == 'W') {
				hold = wholeStep(hold);
				pattern.add(hold.text);
			}
			
			if(scalePattern.charAt(i) == 'T') {
				hold = wholeHalfStep(hold);
				pattern.add(hold.text);
			}
		}
		
		return pattern;
	}
}

